import './App.css';
import Header from "./components/header/Header";
import CardList from "./components/card_list/CardList";
import ModaleCart from "./components/modale_cart/ModaleCart";
import React from "react";


function App() {
    return (
        <div className="App">
            <Header/>
            <ModaleCart/>
            <CardList/>
        </div>
    );
}

export default App;
